css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.fedexvac.org") {

#art-main {
    background-color: #271542 ;
}

.art-header:after {
    background-position: center center;
    background-repeat: no-repeat;
    content: ' ';
    display: none;
    height: 182px;
    left: 12px;
    position: absolute;
    right: 12px;
    top: 0;
    z-index: -1;
}

.art-header:before {
    background-image: url('http://i.imgur.com/rBsXUSl.jpg') ;
    background-position: top center;
    background-repeat: no-repeat;
    content: ' ';
    display: block;
    height: 182px;
    position: absolute;
    top: 0;
    width: 100%;
    z-index: -2;
}

.art-nav:before, .art-nav:after {
    display: none;
}
}
